import React from 'react';

function Footer() {
  return (
    <footer className="fixed-bottom row">
      <div className="col col-md-6 justify-content-center">West Palm Beach</div>
      <div className="col col-md-6 justify-content-center">Coconut Creek</div>
    </footer>
  );
}

export default Footer;
